import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import Topbar from "./Topbar";
function App() {
  return (
    <div className="Appdiv">
      <Header />
      <Topbar />
      <Note />
      <Footer />
    </div>
  );
}

export default App;
